import React from 'react'
import classes from './WeightForm.module.css'

function WeightForm() {
    return(
        <form className = {classes.form}>
            <label for="date-of-tracking">Date of Tracking the Weight:</label>
            <input type= "date" id="dot" name="dot" className = {classes.date}/>
            <label for="weight">Weight (in Kilos)</label>
            <input type= "number" min= "0" step= "0.01" className = {classes.weight}/>
        </form>
    )
}

export default WeightForm
